import React, { useEffect, useState } from "react";
import "./apiCss.css";

const ApiPage = () => {
    const [users, setUsers] = useState([])

    const fetchUserData = () => {
      fetch("https://api.coincap.io/v2/assets")
        .then(response => {
          return response.json()
        })
        .then(data => {
          setUsers(data)
        })
    }

    useEffect(() => {
      fetchUserData()
    }, [])

    return (
      <div>
        {users.length > 0 && (
          <ul>
            {users.map(user => (
              <li key={user.id}>{user.name}</li>
            ))}
          </ul>
        )}
      </div>
    );
  }

  export default ApiPage;
